// Geist Sans Regular font as base64 (woff2 format)
export const geistFontBase64 = "";

/**
 * Get an icon SVG string by provider name.
 * Returns a placeholder if icon not found.
 */
export function getIcon(provider: string): string {
  const icon = icons[provider.toLowerCase()];
  if (icon) return icon;
  
  // Return placeholder with provider initials
  const initials = provider.slice(0, 2).toUpperCase();
  return `<span class="text-xs text-gray-400">${initials}</span>`;
}
